(1, 'SiatiAduanas', 'Empresa Siatiaduanas', 'SELECT %s.%s AS hardwareID , %s.%s AS hardwareDEVICEID , %s.%s AS hardwareNAME , %s.%s AS hardwareWORKGROUP , %s.%s AS hardwareUSERDOMAIN , %s.%s AS hardwareOSNAME , %s.%s AS hardwareOSVERSION , %s.%s AS hardwareOSCOMMENTS , %s.%s AS hardwarePROCESSORT , %s.%s AS hardwarePROCESSORS , %s.%s AS hardwarePROCESSORN , %s.%s AS hardwareMEMORY , %s.%s AS hardwareSWAP , %s.%s AS hardwareIPADDR , %s.%s AS hardwareDNS , %s.%s AS hardwareDEFAULTGATEWAY , %s.%s AS hardwareETIME , %s.%s AS hardwareLASTDATE , %s.%s AS hardwareLASTCOME , %s.%s AS hardwareQUALITY , %s.%s AS hardwareFIDELITY , %s.%s AS hardwareUSERID , %s.%s AS hardwareTYPE , %s.%s AS hardwareDESCRIPTION , %s.%s AS hardwareWINCOMPANY , %s.%s AS hardwareWINOWNER , %s.%s AS hardwareWINPRODID , %s.%s AS hardwareWINPRODKEY , %s.%s AS hardwareUSERAGENT , %s.%s AS hardwareCHECKSUM , %s.%s AS hardwareSSTATE , %s.%s AS hardwareIPSRC , %s.%s AS hardwareUUID , %s.%s AS hardwareARCH , %s.%s AS hardwareCATEGORY_ID , %s.%s AS hardwareARCHIVE , %s.%s AS devicesID , %s.%s AS devicesHARDWARE_ID , %s.%s AS devicesNAME , %s.%s AS devicesIVALUE , %s.%s AS devicesTVALUE , %s.%s AS devicesCOMMENTS , %s.%s AS accountinfoHARDWARE_ID , %s.%s AS accountinfoTAG , %s.%s AS accountinfofields_6 FROM hardware INNER JOIN devices on hardware.id = devices.hardware_id INNER JOIN accountinfo on hardware.id = accountinfo.hardware_id WHERE %s.%s %s \'%s\' AND %s.%s %s \'%s\'  GROUP BY hardware.id', 'hardware,ID,hardware,DEVICEID,hardware,NAME,hardware,WORKGROUP,hardware,USERDOMAIN,hardware,OSNAME,hardware,OSVERSION,hardware,OSCOMMENTS,hardware,PROCESSORT,hardware,PROCESSORS,hardware,PROCESSORN,hardware,MEMORY,hardware,SWAP,hardware,IPADDR,hardware,DNS,hardware,DEFAULTGATEWAY,hardware,ETIME,hardware,LASTDATE,hardware,LASTCOME,hardware,QUALITY,hardware,FIDELITY,hardware,USERID,hardware,TYPE,hardware,DESCRIPTION,hardware,WINCOMPANY,hardware,WINOWNER,hardware,WINPRODID,hardware,WINPRODKEY,hardware,USERAGENT,hardware,CHECKSUM,hardware,SSTATE,hardware,IPSRC,hardware,UUID,hardware,ARCH,hardware,CATEGORY_ID,hardware,ARCHIVE,devices,ID,devices,HARDWARE_ID,devices,NAME,devices,IVALUE,devices,TVALUE,devices,COMMENTS,accountinfo,HARDWARE_ID,accountinfo,TAG,accountinfo,fields_6,devices,NAME,=,,hardware,UUID,>,'),
(2, 'Siatiexpress', 'Empresa Siatiaduanas', 'SELECT %s.%s AS hardwareID , %s.%s AS hardwareDEVICEID , %s.%s AS hardwareNAME , %s.%s AS hardwareWORKGROUP , %s.%s AS hardwareUSERDOMAIN , %s.%s AS hardwareOSNAME , %s.%s AS hardwareOSVERSION , %s.%s AS hardwareOSCOMMENTS , %s.%s AS hardwarePROCESSORT , %s.%s AS hardwarePROCESSORS , %s.%s AS hardwarePROCESSORN , %s.%s AS hardwareMEMORY , %s.%s AS hardwareSWAP , %s.%s AS hardwareIPADDR , %s.%s AS hardwareDNS , %s.%s AS hardwareDEFAULTGATEWAY , %s.%s AS hardwareETIME , %s.%s AS hardwareLASTDATE , %s.%s AS hardwareLASTCOME , %s.%s AS hardwareQUALITY , %s.%s AS hardwareFIDELITY , %s.%s AS hardwareUSERID , %s.%s AS hardwareTYPE , %s.%s AS hardwareDESCRIPTION , %s.%s AS hardwareWINCOMPANY , %s.%s AS hardwareWINOWNER , %s.%s AS hardwareWINPRODID , %s.%s AS hardwareWINPRODKEY , %s.%s AS hardwareUSERAGENT , %s.%s AS hardwareCHECKSUM , %s.%s AS hardwareSSTATE , %s.%s AS hardwareIPSRC , %s.%s AS hardwareUUID , %s.%s AS hardwareARCH , %s.%s AS hardwareCATEGORY_ID , %s.%s AS hardwareARCHIVE , %s.%s AS accountinfoHARDWARE_ID , %s.%s AS accountinfoTAG , %s.%s AS accountinfofields_6 FROM hardware INNER JOIN accountinfo on hardware.id = accountinfo.hardware_id WHERE %s.%s %s \'%s\'  GROUP BY hardware.id', 'hardware,ID,hardware,DEVICEID,hardware,NAME,hardware,WORKGROUP,hardware,USERDOMAIN,hardware,OSNAME,hardware,OSVERSION,hardware,OSCOMMENTS,hardware,PROCESSORT,hardware,PROCESSORS,hardware,PROCESSORN,hardware,MEMORY,hardware,SWAP,hardware,IPADDR,hardware,DNS,hardware,DEFAULTGATEWAY,hardware,ETIME,hardware,LASTDATE,hardware,LASTCOME,hardware,QUALITY,hardware,FIDELITY,hardware,USERID,hardware,TYPE,hardware,DESCRIPTION,hardware,WINCOMPANY,hardware,WINOWNER,hardware,WINPRODID,hardware,WINPRODKEY,hardware,USERAGENT,hardware,CHECKSUM,hardware,SSTATE,hardware,IPSRC,hardware,UUID,hardware,ARCH,hardware,CATEGORY_ID,hardware,ARCHIVE,accountinfo,HARDWARE_ID,accountinfo,TAG,accountinfo,fields_6,hardware,USERID,LIKE,%GYE%');
